import React, { useState } from "react";
import { Chart } from "react-google-charts";


const DataTable = () => {
  // Sample data for the table
  const tableData = [
    { id: 1, name: "Johny Bravo", username: "OhMama", email: "johny@gmail.com", date: "28 Jan, 12:30 AM", status: "Active" },
    { id: 2, name: "Johny Maskulado", username: "OhMuscle", email: "masku@gmail.com", date: "25 Jan, 10:40 PM", status: "Active" },
    { id: 3, name: "Abdul Jakol", username: "Alahooooo!", email: "abdul@gmail.com", date: "20 Jan, 10:40 PM", status: "Disabled" },
    { id: 4, name: "Wilson Smith", username: "Lalalala", email: "wsmith@gmail.com", date: "15 Jan, 03:29 PM", status: "Disabled" },
    { id: 5, name: "Emilly Sing", username: "Yeaaaahh!", email: "ESing@gmail.com", date: "14 Jan, 10:40 PM", status: "Active" },
  ];

  const [currentPage, setCurrentPage] = useState(1);
  const rowsPerPage = 5; // You can adjust the number of rows displayed per page

  // Pagination
  const totalPages = Math.ceil(tableData.length / rowsPerPage);

  return (
    <div className="overflow-x-auto w-full p-6">
      <table className="min-w-full table-auto">
        <thead className="bg-gray-100">
          <tr>
            <th className="px-4 py-2">Action</th>
            <th className="px-4 py-2">Full Name</th>
            <th className="px-4 py-2">Username</th>
            <th className="px-4 py-2">Email</th>
            <th className="px-4 py-2">Date Created</th>
            <th className="px-4 py-2">Status</th>
          </tr>
        </thead>
        <tbody>
          {tableData
            .slice((currentPage - 1) * rowsPerPage, currentPage * rowsPerPage)
            .map((row) => (
              <tr key={row.id} className="border-t">
                <td className="px-4 py-2">
                  <button className="text-blue-500">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      fill="none"
                      viewBox="0 0 24 24"
                      stroke="currentColor"
                      className="w-5 h-5"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        strokeWidth={2}
                        d="M15.232 5.232l3.536 3.536M9 11l6 6m0 0l-6-6m6 6L9 11m0 0L3 5.232M12 21v-6m0-6h6m-6 0H6"
                      />
                    </svg>
                  </button>
                </td>
                <td className="px-4 py-2">{row.name}</td>
                <td className="px-4 py-2">{row.username}</td>
                <td className="px-4 py-2">{row.email}</td>
                <td className="px-4 py-2">{row.date}</td>
                <td className="px-4 py-2">
                  {row.status === "Active" ? (
                    <span className="text-green-500">{row.status}</span>
                  ) : (
                    <span className="text-red-500">{row.status}</span>
                  )}
                </td>
              </tr>
            ))}
        </tbody>
      </table>

      {/* Pagination */}
      <div className="flex justify-between items-center mt-4">
        <button
          onClick={() => setCurrentPage(currentPage - 1)}
          disabled={currentPage === 1}
          className={`text-blue-500 px-4 py-2 ${currentPage === 1 && "opacity-50"}`}
        >
          Previous
        </button>

        <div className="text-gray-600">
          Page {currentPage} of {totalPages}
        </div>

        <button
          onClick={() => setCurrentPage(currentPage + 1)}
          disabled={currentPage === totalPages}
          className={`text-blue-500 px-4 py-2 ${currentPage === totalPages && "opacity-50"}`}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default DataTable;



